tables.table_schema:
CREATE TABLE celebrity_collaborations ( 
  id INT PRIMARY KEY, 
  celebrity_name VARCHAR(255), 
  designer_name VARCHAR(255), 
  collaboration_date DATE 
 );

CREATE TABLE designer_portfolio ( 
  id INT PRIMARY KEY, 
  designer_name VARCHAR(255), 
  designer_age INT, 
  designer_city VARCHAR(255) 
 );

CREATE TABLE celebrity (
    celebrity_id INT PRIMARY KEY,
    celebrity_name VARCHAR(255) NOT NULL,
    profession VARCHAR(100) NOT NULL
);

CREATE TABLE designer (
    designer_id INT PRIMARY KEY,
    designer_name VARCHAR(255) NOT NULL,
    brand_name VARCHAR(100) NOT NULL
);

CREATE TABLE celebrities (
	celebrity_id INT PRIMARY KEY,
	name VARCHAR,
	age INT,
	nationality VARCHAR
);

CREATE TABLE designers (
	designer_id INT PRIMARY KEY,
	name VARCHAR,
	age INT,
	design_style VARCHAR
);

CREATE TABLE collaborations (
	collaboration_id INT PRIMARY KEY,
	celebrity_id INT,
	designer_id INT,
	collaboration_date DATE
);

CREATE TABLE clothing_items (
	item_id INT PRIMARY KEY,
	item_name VARCHAR,
	item_type VARCHAR,
	item_color VARCHAR
);

CREATE TABLE collaborations_clothing (
	collaboration_id INT,
	item_id INT,
	quantity INT,
	PRIMARY KEY (collaboration_id, item_id)
);
